/* eslint-disable no-unused-vars */
import React from 'react';
import {Jumbotron, Button} from 'react-bootstrap';

import { useSelector } from 'react-redux';

export default function Main() {
  const sleepObj = useSelector((state) => state.sleep);

  const conditionalRenderForMain = () => {
    if (!sleepObj)
      return (
        <Jumbotron>
          <h1>Hello, this is a sleeping app.</h1>
          <p>
            We are here to help mothers to sleep more. Is it possible? Yes, you just need to know to to organize sleep of your baby.
          </p>
          <p>
            <Button variant="primary">I want to sleep more!</Button>
          </p>
        </Jumbotron>
      );
    return <> {sleepObj}</>;
  };

  return <div>{conditionalRenderForMain}</div>;
}
